    [],nt"num_tags": 0,nt"name": "ichthyoplankton-data-stock-assessment-and-improvement-program",nt"isopen":
    false,nt"url": null,nt"notes": "This project currently supports two main
    efforts:nn1. An annual sampling regime of the hydrology, plankton and small fish
    along transects over the Continental Shelf from southern Oregon to Washington. This
    consistent survey has generated significant information on within-year variability
    in the California Current Marine Ecosystem, and has yielded valuable insights into
    the food web off our coast. Parameters collected during this effort are used in
    forecasts involving species, assemblages, and ecosystems.nn2. Collection of specimens
    for diet analysis, growth, containment load, and other studies related to the ecology
    and production of commercially important taxa and their relationships to the food
    web.nnWe towed a 71 cm diameter Bongo net at each trawl station from 100 m to the
    surface.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
